    description_region: "Le Conflans, domaine de la maison Tully de Vivesaigues, est une région de Westeros bordée par le Neck au nord, par le Val d'Arryn et les Terres de la Couronne à l'est, et par le Bief et les Terres de l'Ouest au sud et à l'ouest. C'est une région densément peuplée et fertile, traversée par de nombreux cours d'eau. Les bâtards y sont nommés « Rivers ». Les maisons Frey des Jumeaux, Mallister de Salvemer, Bracken de la Haye-Pierre, Nerbosc de Corneilla, Darry de Darry-le-château et Racin de Herpivoie ont leurs fiefs au nord du Conflans. Les maisons Whent d'Harrenhal, Petibois de La Glandée, Piper de Château-Rosières et Mouton de Viergétang ont, eux, leurs fiefs au sud de la région. Sa localisation centrale et sa topographie en fait une région-pivot des Sept Couronnes, un carrefour tant géographique que stratégique, tout en étant dépourvue des défenses naturelles présentes dans d'autres régions. Lieu de nombreuses batailles, elle est passée de mains en mains au cours des siècles sans jamais devenir le « huitième » royaume de Westeros. À l'époque d'Aegon le Conquérant, le Conflans était dirigé par Harren le Noir, le roi des Îles de fer. La maison Tully se rebella contre lui et s'allia à Aegon Targaryen, devenant par la suite la principale maison de la région.",
