    nameFamilly: 'Corbray',
    description_region: "Le Val d'Arryn est une région montagneuse bordée par le Conflans à l'ouest et les Terres de la Couronne au sud. Le Val en lui-même entoure presque entièrement les montagnes de la Lune, situées à l'est de Westeros. C'est le domaine de la maison Arryn, l'une des plus anciennes famille noble descendante des Andals, et, avant la conquête d'Aegon Targaryen, rois des Montagnes et du Val. Sa capitale, les Eyrié, est un petit château réputé insaisissable. Les maisons Sunderland de Sortonne, Froideseaux de Froideseaux, Pryor du Galet, Elesham des Piz, Lynderly de Guivrebois, Corbray de Cordial et Belmore de Forchant occupent les fiefs nordiques de la région. Les maisons Vanbois des Chênes-en-Fer, Melcolm de Vieux Havre, Royce de Roche-aux-Runes, Grafton de Goëville, Rougefort de Rougefort et Cirley de Combemèche ont leurs fiefs au sud du Val d'Arryn. La seule route menant au Val est un sentier de montagne périlleux, grouillant d'animaux sauvages appelés lynx-de-fumée, parsemé d'éboulements, et régulièrement attaqué par des clans montagnards ne se soumettant pas à l'autorité royale. La route aboutit à l'unique entrée du Val, la Porte sanglante, qui consiste en une paire de tours de guet connectée par un pont, située sur un rétrécissement de la route où à peine quatre hommes peuvent marcher côte à côte. Peu après la porte, le val s'étend aux pieds du voyageur. La protection naturelle qu'offrent les montagnes alentour donne au Val un climat tempéré, et il est composé de grands prés fertiles, de bois, de larges rivières et de centaines de petits lacs. La fonte des neiges venue des montagnes, ainsi que la cascade nommée « les Larmes d'Alyssa », en font une région ne craignant pas la sécheresse. Les bâtards y sont nommés « Stone ».",
