    description_castelreel: "Les scènes de la première saison ont été tournées à Mdina (Malte). Depuis la saison 2, Port-Réal est filmée à Dubrovnik. Le palais de Dioclétien à Split est aussi utilisé. Ainsi que les fortifications de la ville de Ston. Les scènes extérieures sont réalisées à l''arboretum de Trsteno.",
