    region: 'Dorne',
    nameFamilly: 'Noirmont',
    description_region: "La péninsule de Dorne, domaine de la maison Martell, se situe au sud-est de Westeros, dont elle constitue la partie la moins peuplée. Les parties frontalières avec le Bief et les Terres de l'Orage sont montagneuses et toutes les autres sont désertiques, avec un climat aride et sec. Des rivières offrent cependant assez de terres fertiles à cultiver ; l'eau y est précieuse mais elle y est suffisamment abondante pour permettre de supporter les longs étés chauds. Dorne est bordée au nord par la mer de Dorne, par les îles des Degrés de Pierre à l'est et à l'ouest par les montagnes rouges précédant les Marches de Dorne ; la côte sud s'étend le long de la mer d'Été. La renommée de Dorne vient des coursiers qui y sont élevés, surnommés « chevaux des sables », ainsi que du commerce des épices, du vin, des produits de la pêche et des textiles. Les Dorniens ont la réputation d'être des gens impétueux, et ils ont globalement des mœurs plus libres que dans le reste du continent. Ils diffèrent à la fois culturellement et ethniquement des autres habitants de Westeros en raison de l'immigration massive des rhoyniens venus d'Essos après la conquête de la reine Nymeria des Rhoynar. Les Dorniens ont adopté beaucoup de coutumes orientales, notamment celle de la primogéniture quel que soit le sexe de l'héritier ou le fait de se faire appeler « Prince » ou « Princesse » plutôt que « Lord » pour les seigneurs nominaux. Les femmes y occupent des postes aussi importants que les hommes. Dorne est la dernière région à avoir été rattachée aux Sept Couronnes à la suite de la conquête d'Aegon, après une résistance de plus de deux cents ans. Malgré le rattachement au Royaume à la suite d'un mariage, cette histoire particulière a laissé à la région une certaine indépendance. Contrairement à l'usage en vigueur à Westeros, les bâtards — qui y sont nommés « Sand » — sont traités de manière presque équivalente aux héritiers légitimes. L'auteur s'est inspiré de la résistance galloise contre l'Angleterre au xie siècle pour représenter la résistance des Dorniens face aux autres régions de Westeros.",
